} Note: The 2..=9 is a Range Pattern , not a Range Expression . Thus, only those types of ranges supported by range patterns can be used in match arms. Every binding in each | separated pattern must appear in all of the patterns in the arm. Every binding of the same name must have the same type, and have the same binding mode.

