All user-defined composite types (structs, enums, and unions) have a representation that specifies what the layout is for the type. The possible representations for a type are: Default C The primitive representations transparent The representation of a type can be changed by applying the repr attribute to it. The following example shows a struct with a C representation. #[repr(C)]
struct ThreeInts { first: i16, second: i8, third: i32
} The alignment may be raised or lowered with the align and packed modifiers respectively. They alter the representation specified in the attribute. If no representation is specified, the default one is altered. // Default representation, alignment lowered to 2.
#[repr(packed(2))]
struct PackedStruct { first: i16, second: i8, third: i32
} // C representation, alignment raised to 8
#[repr(C, align(8))]
struct AlignedStruct { first: i16, second: i8, third: i32
} Note: As a consequence of the representation being an attribute on the item, the representation does not depend on generic parameters. Any two types with the same name have the same representation. For example, Foo<Bar> and Foo<Baz> both have the same representation. The representation of a type can change the padding between fields, but does not change the layout of the fields themselves. For example, a struct with a C representation that contains a struct Inner with the default representation will not change the layout of Inner.

