The C representation is designed for dual purposes. One purpose is for creating types that are interoperable with the C Language. The second purpose is to create types that you can soundly perform operations on that rely on data layout such as reinterpreting values as a different type. Because of this dual purpose, it is possible to create types that are not useful for interfacing with the C programming language. This representation can be applied to structs, unions, and enums. #[repr(C)] Structs The alignment of the struct is the alignment of the most-aligned field in it. The size and offset of fields is determined by the following algorithm. Start with a current offset of 0 bytes. For each field in declaration order in the struct, first determine the size and alignment of the field. If the current offset is not a multiple of the field's alignment, then add padding bytes to the current offset until it is a multiple of the field's alignment. The offset for the field is what the current offset is now. Then increase the current offset by the size of the field. Finally, the size of the struct is the current offset rounded up to the nearest multiple of the struct's alignment. Here is this algorithm described in pseudocode. /// Returns the amount of padding needed after `offset` to ensure that the
/// following address will be aligned to `alignment`.
fn padding_needed_for(offset: usize, alignment: usize) -> usize { let misalignment = offset % alignment; if misalignment > 0 { // round up to next multiple of `alignment` alignment - misalignment } else { // already a multiple of `alignment` 0 }
} struct.alignment = struct.fields().map(|field| field.alignment).max(); let current_offset = 0; for field in struct.fields_in_declaration_order() { // Increase the current offset so that it's a multiple of the alignment // of this field. For the first field, this will always be zero. // The skipped bytes are called padding bytes. current_offset += padding_needed_for(current_offset, field.alignment); struct[field].offset = current_offset; current_offset += field.size;
} struct.size = current_offset + padding_needed_for(current_offset, struct.alignment); Warning: This pseudocode uses a naive algorithm that ignores overflow issues for the sake of clarity. To perform memory layout computations in actual code, use Layout . Note: This algorithm can produce zero-sized structs. This differs from C where structs without data still have a size of one byte. #[repr(C)] Unions A union declared with #[repr(C)] will have the same size and alignment as an equivalent C union declaration in the C language for the target platform. The union will have a size of the maximum size of all of its fields rounded to its alignment, and an alignment of the maximum alignment of all of its fields. These maximums may come from different fields. #[repr(C)]
union Union { f1: u16, f2: [u8; 4],
} assert_eq!(std::mem::size_of::<Union>(), 4); // From f2
assert_eq!(std::mem::align_of::<Union>(), 2); // From f1 #[repr(C)]
union SizeRoundedUp { a: u32, b: [u16; 3],
} assert_eq!(std::mem::size_of::<SizeRoundedUp>(), 8); // Size of 6 from b, // rounded up to 8 from // alignment of a.
assert_eq!(std::mem::align_of::<SizeRoundedUp>(), 4); // From a #[repr(C)] Enums For C-like enumerations , the C representation has the size and alignment of the default enum size and alignment for the target platform's C ABI. Note: The enum representation in C is implementation defined, so this is really a "best guess". In particular, this may be incorrect when the C code of interest is compiled with certain flags. Warning: There are crucial differences between an enum in the C language and Rust's C-like enumerations with this representation. An enum in C is mostly a typedef plus some named constants; in other words, an object of an enum type can hold any integer value. For example, this is often used for bitflags in C. In contrast, Rust’s C-like enumerations can only legally hold the discriminant values, everything else is undefined behaviour. Therefore, using a C-like enumeration in FFI to model a C enum is often wrong. It is an error for zero-variant enumerations to have the C representation. For all other enumerations, the layout is unspecified. Likewise, combining the C representation with a primitive representation, the layout is unspecified.

